"use es6";

import React from "react";
import stars from "../images/stars.png";
import stripes from "../images/stripes.png";
import * as d3 from "d3";

const HomePage = () => {
  const canvasstyle = {
    width: "fit-content",
    height: "fit-content",
  };

  const starsstyle = {
    backgroundColor: "#000077",
    width: "fit-content",
    height: "fit-content",
  };

  const stripesstyle = {
    backgroundColor: "#770000",
    width: "fit-content",
    height: "fit-content",
  };

  var svgContainer = d3
    .select("#canvas")
    .append("svg")
    .attr("align", "center")
    .attr("width", 1105)
    .attr("height", 700);

  const x = 100;
  const y = 100;

  const xcoors1 = [x + 50, x + 150, x + 250, x + 350, x + 450, x + 550];
  const xcoors2 = [x + 100, x + 200, x + 300, x + 400, x + 500];

  for (let i = 0; i < 9; i++) {
    if (i % 2 == 0) {
      svgContainer
        .append("polygon")
        .attr("fill", `#ffffff`)
        .attr("stroke", "green")
        .attr(
          "points",
          `${x},${y} ${x + 26},${y} ${x + 35},${y - 25} ${x + 44},${y} ${
            x + 70
          },${y} ${x + 50},${y + 17.5} ${x + 57.5},${y + 42.5} ${x + 35},${
            y + 27.5
          } ${x + 12.5},${y + 42.5} ${x + 20},${y + 17.5}`
        );
    }
  }

  return (
    <>
      <div>
        <h1>HOME</h1>
        <div id="canvas" style={canvasstyle}></div>
        <div style={starsstyle}>
          <img src={stars} alt={"stars"} />
        </div>
        <div style={stripesstyle}>
          <img src={stripes} alt={"stripes"} />
        </div>
      </div>
    </>
  );
};

export default HomePage;
